import { Route, Routes } from "react-router-dom"
import { Authorized } from "./views/Authorized"
import { ApplicationViews } from "./views/ApplicationViews"
import { NavBar } from "./nav/NavBar"
import { Login } from "./auth/Login"
import { Register } from "./auth/Register"
import { ClientViews } from "./views/ClientViews"
import "./FatBackStudio.css"


export const FatBackStudio = () => {

	const localFatBackUser = localStorage.getItem("fatback_user")
	const fatbackUserObject = JSON.parse(localFatBackUser)

	if (fatbackUserObject.staff=false) {
		return <Routes>
			<Route path="/login" element={<Login />} />
			<Route path="/register" element={<Register />} />

			<Route path="*" element={
				<Authorized>
					<>
						<NavBar />
						<ApplicationViews />
					</>
				</Authorized>

			} />

		</Routes>
	} else { 
		return <ClientViews/> 
	}

}
